detaileddescription.para:
read RDF formatted annotations a string. 

pdf_ptr



a pointer to an RDF object. 




str



the string to read annotations from 




format



the format that the string annotations are in (get it wrong to be provided a list of supported syntaxes) 




baseuri



the uri used for the base. All relative uri's in the RDF graph are relative to the base uri



RDF* rdf_ptr = RDF_fromString(string_annotations, "rdfxml", "string_annotations_base_uri"); //
